css:
:root {
  font-size: 16px;
}
.busy {
  display: inline-block;
  padding-top: 1px;
}
.busy span.icon-gear {
  text-align: center;
  color: rgba(131, 148, 150, 0.5);
}
.busy span.icon-gear.is-busy {
  animation: spin 1.5s linear infinite;
  color: #2196f3;
}
@-webkit-keyframes spin {
  0% {
    transform: rotate(0deg);
  }
  100% {
    transform: rotate(360deg);
  }
}
.spin {
  animation: spin 1.5s linear infinite;
  text-align: center;
}
